import Image from "next/image";
import { useContext } from "react";
import { MusicPlayerContext } from "../../components/MusicPlayerProvider";

enum Platform {
  QQMusic,
  SoundCloud,
}
const getCorrespondingPlatformSVG = (platform: Platform) => {
  switch (platform) {
    case Platform.QQMusic: {
      return "/QQ-Music.svg";
    }
    case Platform.SoundCloud: {
      return "/SoundCloud.svg";
    }
    default: {
      return "";
    }
  }
};
interface CardProps {
  title: string;
  description: string;
  cover: string;
  localSrc: string;
  pubDate: string;
  platforms: Map<Platform, string>; //key is platform, value is link
}
const Card = ({
  title,
  description,
  cover,
  platforms,
  localSrc,
  pubDate,
}: CardProps) => {
  const { setAudioSrc } = useContext(MusicPlayerContext);
  return (
    <div className="card w-full h-full base-100 shadow-xl image-full">
      <figure>
        <Image src={cover} alt="Shoes" layout="fill" />
      </figure>
      <div className="card-body">
        <h2 className="card-title font-black text-3xl">{title}</h2>
        <p>Pub at {pubDate}</p>
        <p className="italic">{description}</p>
        <div className="w-full flex justify-start items-center space-x-5 mt-3">
          {Array.from(platforms).map(([platform, link], idx) => {
            let coverSrc = getCorrespondingPlatformSVG(platform);
            return (
              <div key={idx}>
                <a href={link} target="_blank" rel="noreferrer">
                  <Image src={coverSrc} width="30px" height="30px" alt="Cover" />
                </a>
              </div>
            );
          })}
        </div>
        <div className="card-actions justify-center mt-5">
          <button
            className="btn btn-primary w-full"
            onClick={() => {
              setAudioSrc(localSrc);
            }}
          >
            Listen Now
          </button>
        </div>
      </div>
    </div>
  );
};

const Music = () => {
  const data = DATA; //get global data
  return (
    <div className="pt-32 px-[5%]">
      <div className="grid grid-cols-1 md:grid-cols-3 gap-x-8 gap-y-10">
        {data.map((item, idx) => {
          return (
            <Card
              key={idx}
              title={item.title}
              description={item.description}
              cover={item.cover}
              platforms={item.platforms}
              localSrc={item.localSrc}
              pubDate={item.pubDate}
            />
          );
        })}
      </div>
    </div>
  );
};

//update this DATA if modify or add new music
